import React, { useEffect } from 'react';
import './../Home.css'; // Adjust the path based on your file structure

const Home = () => {
  useEffect(() => {
    document.title = 'Home - The Little Corner Cafe';
    return () => {};
  }, []);

  return (
    <div className="home-container">
      <h1>Welcome to The Little Corner Cafe!</h1>
      <img
        className="home-image"
        src="https://www.posist.com/restaurant-times/wp-content/uploads/2023/07/How-To-Start-A-Coffee-Shop-Business-A-Complete-Guide.jpg"
        alt="Coffee Shop"
      />
    </div>
  );
};

export default Home;
